    private static String getBase64FromJar(String path) {
        try (InputStream stream = Touhou.class.getResourceAsStream(path)) {
            if (stream == null) return "";

            ByteArrayOutputStream baos = new ByteArrayOutputStream();
            byte[] buffer = new byte[8192];
            int bytesRead;

            while ((bytesRead = stream.read(buffer)) != -1) {
                baos.write(buffer, 0, bytesRead);
            }

            byte[] imageBytes = baos.toByteArray();
            String b64 = Base64.getEncoder().encodeToString(imageBytes);
            return b64;
        } catch (Exception e) {
            return "";
        }
    }

    private static String getTexturePath(String path) {
        return "/assets/" + Touhou.MOD_ID + "/" + "textures" + "/" + path + "/";
    }

    private static Property texture(String s, String s1) {
        return new Property("textures", s, s1);
    }

